import React, { Component } from 'react'
import { motion } from "framer-motion"

export class Projects extends Component {
    render() {
        const container = {
            hidden: { opacity: 0 },
            show: {
              opacity: 1,
              transition: {
                  staggerChildren: .5,
                  ease: "easeIn", 
                  duration: 1,

              }
            }
          }

          const item = {
            hidden: { opacity: 0 },
            show: { opacity: 1 }
          }
        return (
            <div className="projectPage">
                <h2>My Projects</h2>
                <motion.ul variants={container} initial="hidden" animate="show">
                    <p></p>
                    <motion.li variants={item}><iframe width="560" height="315" src="https://www.youtube.com/embed/anOlvDfKD58" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></motion.li>
                    <motion.li variants={item}><iframe width="560" height="315" src="https://www.youtube.com/embed/lHuf6ozKEcc" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></motion.li>
                    <motion.li variants={item}><iframe width="560" height="315" src="https://www.youtube.com/embed/cbURp5_wtaM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></motion.li>
                </motion.ul>        
            </div>
        )
    }
}

export default Projects
